package webDriverPackage;

public class WhileLoopExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// goal is print number from 11 to 20
		int x=11;
		
		while (x<21) 
		{
			System.out.println(x);
			x=x+1;
			// it means that when x=1 and it goes on a loop then x=2 now then go to loop
			// then blah blah. it's increment 1 at this example
		}
		
		
		
	}

}
